import React from 'react'
import Nav from '../Components/Nav'

export default function Machine() {

    
    const handleSubmit = (e) => 
    {
        e.preventDefault();
    }
  return (
    <div className='w-full h-screen flex flex-col items-center justify-start'>
      <Nav/>
        <form onSubmit={handleSubmit} method="post" className='w-full flex flex-col items-center justify-center h-full text-black'>
            <input type="text" placeholder='product Name' className='text-black w-80 h-10 border-2 border-black rounded m-4 p-2'/>
            <input type="text" placeholder='product Price' className='text-black w-80 h-10 border-2 border-black rounded m-4 p-2'/>
            <input type="text" placeholder='product weight' className='text-black w-80 h-10 border-2 border-black rounded  m-4 p-2'/>
            <input type="text" placeholder='product description' className='text-black w-80 h-10 border-2 border-black rounded m-4 p-2'/>
            <input type="file" placeholder='product Name' className='text-black w-80 h-10 border-2 flex items-center justify-center border-black rounded m-4 p-2'/>
            <button type="submit" className='p-2 m-4 border-2 border-black w-56 h-15 cursor-pointer'>submit</button>
            <button type="reset"  className='p-2 m-4 border-2 border-black w-56 h-15 cursor-pointer'>Reset</button>
        </form>
    </div>
  )
}
